// @ts-check

import eslint from "@eslint/js";
import tseslint from "typescript-eslint";
import reactHooks from "eslint-plugin-react-hooks";
import unicorn from "eslint-plugin-unicorn";

export default tseslint.config({
  files: ["**/*.{ts,tsx}"],
  ignores: [
    "**/*.d.ts",
    "**/__generated__/**",
    "codemod/**",
    "packages/*/lib/**",
    "packages/prisma-client/prisma/migrations/**",
    "packages/cli/templates/**",
    "fixtures/**",
  ],
  extends: [
    eslint.configs.recommended,
    ...tseslint.configs.recommended,
    {
      plugins: {
        "react-hooks": /** @type {any} */ (reactHooks),
        unicorn,
      },
    },
  ],
  // @ts-ignore
  rules: {
    ...reactHooks.configs.recommended.rules,
    "no-console": ["error", { allow: ["info", "warn", "error"] }],
    "no-unused-vars": "off",
    "@typescript-eslint/no-unused-vars": "off",
    "@typescript-eslint/no-unused-expressions": "off",
    "func-style": ["error", "expression", { allowArrowFunctions: true }],
    curly: "error",
    eqeqeq: ["error", "always", { null: "ignore" }],
    camelcase: ["error", { properties: "never" }],
    radix: "error",
    "unicorn/filename-case": ["error", { case: "kebabCase" }],
    "unicorn/prefer-node-protocol": "error",
    "no-restricted-syntax": [
      "error",
      {
        message:
          "Do not import default from React, use a named imports instead",
        selector:
          'ImportDeclaration[source.value="react"] ImportDefaultSpecifier',
      },
    ],
  },
});

import * as process from "process";

export const config = {
  lostPixelProjectId: "cleiive6c0gchi40em3uzx1xv",
  apiKey: process.env.LOST_PIXEL_API_KEY,
};

import { defineConfig } from "vite";

export default defineConfig({
  // resolve only webstudio condition in tests
  resolve: {
    conditions: ["webstudio"],
  },
});

import { defineConfig } from "vite";

const isBareImport = (id: string) =>
  id.startsWith("@") || id.includes(".") === false;

export default defineConfig({
  // resolve only webstudio condition in tests
  resolve: {
    conditions: ["webstudio"],
  },
  build: {
    lib: {
      entry: [
        "src/components.ts",
        "src/metas.ts",
        "src/props.ts",
        "src/hooks.ts",
        "src/templates.ts",
      ],
      formats: ["es"],
    },
    rollupOptions: {
      external: isBareImport,
      output: {
        preserveModules: true,
        preserveModulesRoot: "src",
        dir: "lib",
      },
    },
  },
});
